var render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('div',{staticClass:"page-greeting"},[_c('BgTop'),_vm._ssrNode(" <div class=\"heading-en under-en-title\" data-v-f8033536>Corporate Philosophy</div> <div class=\"greeting__desc\" data-v-f8033536><h1 class=\"large-ja\" data-v-f8033536><span class=\"ja\" data-v-f8033536>企業理念</span></h1> <div class=\"desc__txt\" data-v-f8033536><div class=\"txt-bg\" data-v-f8033536></div> <h3 data-v-f8033536>人とシステムをつくる会社</h3></div></div> <section class=\"greeting__greeting\" data-v-f8033536><h2 data-v-f8033536>代表あいさつ</h2> <div class=\"greeting__greeting__wrap\" data-v-f8033536><div class=\"greeting__greeting__wrap__txt\" data-v-f8033536>\n                私たちが掲げる「システムをつくる」という言葉には、単にお客様から依頼された要件や機能を満たす以上の意味を含んでいます。なぜなら、システムの先には必ずお客様の「自社をこう変えたい」「社会に対してこんな変化を生みたい」という思いがあるからです。その思いを読み取り、システムに置き換えて実現へのプロセスをお手伝いするのが私たちＢＦＴの大切な役割です。\n                <br data-v-f8033536><br data-v-f8033536>\n                また「人をつくる」という言葉には、自社で蓄積したシステム関連のナレッジを積極的に社会へ還元していく理念を込めています。自分たちが技術力や知識をつけて成長するのはもちろんのこと、さらにシステムにつながる他企業・他分野の皆さんにも教育や育成などの「人づくり」の面から貢献したいと考えています。\n                <br data-v-f8033536><br data-v-f8033536>\n                本来、システムをつくる仕事はとてもクリエイティブで面白いものです。お客様は良質なシステムによって社会に影響をもたらす大きな力を得られ、私たちはシステムの構成や機能・情報の動線づくりで大いに自己表現できます。双方の思いが噛み合ったときに生まれる成果はお互いの期待値をはるかに超え、その達成感と充足感は他に代えがたいものがあります。\n                <br data-v-f8033536><br data-v-f8033536>\n                すべての案件でお客様とともにそんな幸せな体験ができるよう、私たちは「システムづくり」の技術とニーズへの対応力を磨き、「人づくり」によってシステムをつくる仕事の楽しさや面白さ、未来に続く可能性をお伝えしていきます。\n                <br data-v-f8033536><br data-v-f8033536> <h3 class=\"greeting__greeting__wrap__txt--head-mid\" data-v-f8033536>\n                    デジタル技術で感動の連鎖を生む\n                </h3>\n                私たちはデジタル技術によってシステムを構築し、社会に貢献していく企業です。また経験や実績から得たナレッジを伝え、デジタル技術を理解し活用できる人材を育てるのも大事な使命です。どちらにも共通しているのは「自分だけの能力を高めるだけでなく、得られた成果をもっと多くの人に伝えていく」という考え方です。伝えた人々が社会をさらに良くしていくこと、私たちの提供したサービス以上に「幸せ」が遠くへ広がっていくこと、この「連鎖」が私たちの理想とする形です。\n                <br data-v-f8033536><br data-v-f8033536>\n                そのために私たちはシステムに携わる方々との接点を大切にしています。システムつくりはその完成がゴールではありません。プロフェッショナルの立場からシステム化の本質的なニーズをつかみ、求められる方式や手段をお客様にわかりやすい言葉で説明するなど、そのプロセスが大切です。このようなシステムづくりを通して、私たちはその先にあるお客様のビジネスにつながり、さらにそれをより良い未来につなげていきます。\n                <br data-v-f8033536><br data-v-f8033536>\n                システムを利用する人々のリテラシーやシステムによってサービスを提供する会社のリテラシーが上がれば、より高度なシステム構築ができます。同時にシステムをつくる私たちに要求される技術力や対応力も高まりますが、それは負荷ではなく成長に必要な課題です。私たちは2002年に創業した当初からこの課題に一貫して取り組んでいます。\n                <br data-v-f8033536><br data-v-f8033536> <p class=\"greeting__greeting__wrap__signature\" data-v-f8033536>\n                    株式会社ＢＦＴ 代表取締役　小林 道寛\n                </p></div></div></section>")],2)}
